function palindrome(str) {
  str = str.replace(/ |,|_|\.|-|\/|\(|\)/ig, "").toLowerCase()
  let strEndToStart = ""
  for (let i = str.length -1; i >= 0; i--) {
    strEndToStart+=str[i]
  }
  return strEndToStart === str;
}

console.log(palindrome("eye"));
console.log(palindrome("0_0 (: /-\ :) 0-0"))

const map = {
  1: "I",
  4: "IV",
  5: "V",
  6: "VI",
  9: "IX",
  10: "X",
  40: "XL",
  50: "L",
  90: "XC",
  100: "C",
  400: "CD",
  500: "D",
  900: "CM",
  1000: "M"
}

function convertToRoman(num) {
  num = `${num}`
  let numberStr = ""

  for (let i = num.length - 1; i >= 0; i--) {
    let val = (num[i]) * 10 ** (num.length - (i + 1))

    const int = 10 ** (num.length - (i + 1))

    let numeralValue
    if (val === 9 * int) {
      numeralValue = (`${map[int]}` + map[int * 5])
    } else if (val >= 6 * int) {
      numeralValue = (`${map[(val - (val - 5))*int]}` + map[int].repeat(val/int - 5))
    } else if (val >= 4 * int) {
      numeralValue = (`${map[int]}` + map[int * 5])
    }

    numberStr = (map[val] ?? numeralValue ?? map[int].repeat(num[i])) + numberStr
  }

  return numberStr;
}

console.log(convertToRoman(68))
console.log(convertToRoman(83))

const alphabet = "ABCDEFGHIJKLMNOPQRSTUVWXYZ"
const alphabetArray = []
for (const letter of alphabet) alphabetArray.push(letter)

function rot13(str) {
  return str.split("").map((element) => {

    const index = alphabetArray.indexOf(element)

    if (index === -1) return element;

    return alphabetArray[index - 13 >= 0 ? index - 13 : alphabetArray.length + (index - 13)]

  }).join("");
}

console.log(rot13("SERR PBQR PNZC"));
console.log(rot13("SERR YBIR?"))
